package com.karn.leetcode;

import org.junit.Test;

import java.io.FileInputStream;
import java.io.FileNotFoundException;
import java.util.Scanner;

import static org.junit.Assert.*;

public class MinimumWindowSubstringTest {

    @Test
    public void test1() throws FileNotFoundException {
        Scanner sc=new Scanner(new FileInputStream("MinimumWindowSubstring.txt"));
        String s = sc.next();
        String t = sc.next();

        long start=System.currentTimeMillis();
        System.out.println("Started ");
        String out = new MinimumWindowSubstring().minWindow(s,
                t);
        System.out.println("Ended "+(System.currentTimeMillis()-start)+" ms");
        assertEquals(out,"");
    }

    @Test
    public void test2() throws FileNotFoundException {
        Scanner sc=new Scanner(new FileInputStream("MinimumWindowSubstring.txt"));
        String s = sc.next();
        String t = sc.next();

        long start=System.currentTimeMillis();
        System.out.println("Started ");
        String out = new MinimumWindowSubstringResolved().minWindow(s,
                t);
        System.out.println("Ended "+(System.currentTimeMillis()-start)+" ms");
        assertEquals(out,"");
    }
}